  return (
    <div className="navBar">
      <div className="navBarContainer">
        <div className="navBarList">
          <div className="navBarListItem active">
            <FontAwesomeIcon icon={props.icon} />
            <span>{props.type}</span>
          </div>
        </div>
      </div>
    </div>
  );
};
export default NavBarItem;
